import { useCallback } from "react";
import { useParams, useNavigate, createSearchParams, useSearchParams } from "react-router-dom";

const ReadPage = () => {
    const {tno} = useParams()
    const navigate = useNavigate()
    const [queryParams] = useSearchParams()
    const moveToModify = useCallback((tno) => {
        navigate({ pathname: '/todo/modify/${tno}' })
    },[tno])
    
    return (
        <div className="text-3xl font-extrabold">Todo Read page component {tno}        
            <div>
                <button onClick={() => moveToModify(33)}>Test Modify</button>
            </div>
        </div>
    );
}

export default ReadPage;
